import style from "./HelpImigration.module.scss";
import { Container } from "../Container/Container";
export const HelpImigration = () => {
  return <div className={style.help}>
    <Container>
      <div className={style.help_container}>
        <div className={style.text_items}></div>
        <div className={style.img_items}>
          <img className={style.img_girls} src="../assets/girls/png" alt="" />
        </div>
      </div>
    </Container>
    
  </div>;
};
